import React, { useEffect } from "react";
import { Modal, Button, Form } from "react-bootstrap";
import { useTransactionContext } from "./transaction-context";

// EditTransactionForm component allows users to edit an existing transaction
const EditTransactionForm = ({
  show,
  handleClose,
  handleSubmit,
  handleInputChange,
  transaction,
  updatedTransaction,
  setUpdatedTransaction,
}) => {
  const { setState } = useTransactionContext();

  useEffect(() => {
    // Initialize the updatedTransaction state with the selected transaction data
    if (transaction) {
      setState((prevState) => ({
        ...prevState,
        updatedTransaction: transaction,
      }));
    }
  }, [transaction, setState]);

  // Handle form submission to update the transaction
  const handleFormSubmit = (event) => {
    event.preventDefault();
    if (updatedTransaction) {
      handleSubmit(updatedTransaction);
      handleClose();
    }
  };

  // Check if the form is valid
  const isFormValid =
    updatedTransaction &&
    updatedTransaction.description &&
    updatedTransaction.transactionType &&
    updatedTransaction.amount &&
    updatedTransaction.transactionDate;

  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Header closeButton>
        <Modal.Title>Edit Transaction</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        {updatedTransaction && (
          <Form onSubmit={handleFormSubmit}>
            <Form.Group controlId="transactionDescription">
              <Form.Label>Transaction Description</Form.Label>
              <Form.Control
                type="text"
                name="description"
                value={updatedTransaction.description || ""}
                onChange={handleInputChange}
                placeholder="Enter description"
                required
              />
            </Form.Group>
            <Form.Group controlId="transactionType">
              <Form.Label>Transaction Type</Form.Label>
              <Form.Control
                as="select"
                name="transactionType"
                value={updatedTransaction.transactionType || ""}
                onChange={handleInputChange}
                required
              >
                <option value="">Select type</option>
                <option value="DEPOSIT">Deposit</option>
                <option value="EXPENSE">Expense</option>
                <option value="TRANSFER">Transfer</option>
              </Form.Control>
            </Form.Group>
            <Form.Group controlId="transactionAmount">
              <Form.Label>Amount</Form.Label>
              <Form.Control
                type="number"
                name="amount"
                value={updatedTransaction.amount || ""}
                onChange={handleInputChange}
                placeholder="Enter amount"
                required
              />
            </Form.Group>
            <Form.Group controlId="transactionDate">
              <Form.Label>Date</Form.Label>
              <Form.Control
                type="date"
                name="transactionDate"
                value={updatedTransaction.transactionDate || ""}
                onChange={handleInputChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="recurring">
              <Form.Check
                type="checkbox"
                name="recurring"
                checked={updatedTransaction.recurring || false}
                onChange={handleInputChange}
                label="Recurring"
              />
            </Form.Group>
            {updatedTransaction.recurring && (
              <Form.Group controlId="recurringFrequency">
                <Form.Label>Recurring Frequency</Form.Label>
                <Form.Control
                  type="text"
                  name="recurringFrequency"
                  value={updatedTransaction.recurringFrequency || ""}
                  onChange={handleInputChange}
                  placeholder="Enter frequency"
                />
              </Form.Group>
            )}
            <Button variant="primary" type="submit" disabled={!isFormValid}>
              Save Changes
            </Button>
          </Form>
        )}
      </Modal.Body>
    </Modal>
  );
};

export default EditTransactionForm;
